import React from 'react';
import PropTypes from 'prop-types';
import styles from './calendarBody.scss';


let today = new Date(),
    calendar = today.getFullYear() + '-' + ( today.getMonth() + 1 ) + '-' + today.getDate();

/**
 * General component description in JSDoc format. Markdown is *supported*.
 */
const CalendarBody = ( { text } ) => (

    <div className={styles.calendar__body}>
        <p>Calendar will be here</p>


    </div>
);

CalendarBody.propTypes = {
    /** Description of prop "text". */

    optionsState: PropTypes.string
};

CalendarBody.defaultProps = {
    text: 'defaultText'
};

export default CalendarBody;
